	"text":"Tobias ist ein männlicher Vorname, der auch als Familienname vorkommen kann. Hebräisch = tobijjah „Gott ist gut“, „Jahwe ist gütig“, „Der Herr ist mein Gut“, „Der Gütige“, „Gott ist gnädig“, „Gott ist Güte“. Tobias ist die griechische Form des hebräischen Namens „Tobijah / Tobijahu“. Dieser Name ist abgeleitet von Tobias (Sohn des Tobit), aus „Das Buch Tobit“, ein apokryphes bzw. deuterokanonisches Buch des Alten Testaments. Dort ist Tobias der fromme Sohn eines blinden Vaters. Der Erzengel Raphael begleitet Tobias auf seiner Reise, nimmt sich seiner an und hilft ihm, seinen Vater von der Blindheit zu heilen.",
