	"text":"Peter ist ein männlicher Vorname sowie ein Familienname. Peter ist griechischen Ursprungs (petros) und bedeutet Fels im Sinne von Felsblock. Der gewachsene Felsen wird im Griechischen als petra bezeichnet. In dem Jesus-Wort Matthäus 16,18 tauchen beide Begriffe als Wortspiel nebeneinander auf: „Du bist ‚Petros‘ (Felsblock), und auf ‚Petra‘ (gewachsener Felsen) will ich meine Gemeinde bauen.“. Im Deutschen hat Peter auch den appellativen Sinn von Tölpel „ungeschickter Mensch“. Diese oder ähnliche Bedeutungen treten in Komposita wie Lügenpeter, Heulpeter, Hackepeter oder Ziegenpeter auf. Die Herkunft der Bezeichnungen Schwarzer Peter für ein Kartenspiel, Hackepeter für eine Fleischspeise und Miesepeter für einen übellaunigen Menschen ist unsicher. Der Name der chemischen Substanz Salpeter lehnt sich vielleicht an lateinisch sal petrae „Steinsalz“ an.",
